import React from "react";
import Array from "./Array";
import ReactDOM from "react-dom";
import App from "./App";
import Card from './Card'

function ncard(val) {
  return (
    <>
      <Card
        id={Array.id}
        name={Array.name}
        age={Array.age}
        degree={Array.degree}
      />
    </>
  );
}

ReactDOM.render(Array.map(ncard), document.getElementById("root"));
